import React, { Component } from 'react';

class Landing extends Component {
    render(){
        return(
            <div stype = {{width : '100%', margin: 'auto'}}>
                <Grid className = "landing-grid">
                    <Cell col = {12}></Cell>
                </Grid>
            </div>
        )
    }
}

export default Landing;
